import './Home.css'
import Navbar from '../components/Navbar';
import ProfileCard from '../components/ProfileCard';
import PostCard from '../components/PostCard';
import Post from '../components/Post'
const Home = () => {
    const postDat = {
        user:{
            name:'Sagar Rasuri',
            followers:30,
            profileId:'sagar002'
        },
        post:{
            caption:'contWorld Labs aims to revolutionize AI by advancing visual data processing and sophisticated reasoning, striving for technology that mirrors human-like understanding of the 3D world.ent',
            imageLink:'https://media.licdn.com/dms/image/D5622AQGqxd4QZwU1pw/feedshare-shrink_800/0/1721398419244?e=1724284800&v=beta&t=GPrVNwy5gSvaCcDTxWRVU7ztD6623LwM689-iXXYRIg',
            likes:22,
            comments:3,
        },
        comments:[{
            user:{
                name:'Jogn Doe',
                bio:'Technical lead - Software Development (Node.js | Express.js | AWS)'
            }
        }]
    }
    return(
        <div>
            <div>
                <Navbar/>
            </div>
            <div className='content'>
                <div className='profile-card'>
                    <ProfileCard isMore={false}/>
                </div>
                <div className='post-container'>
                    <PostCard/>
                </div>
                <div className='post'>
                    <Post/>
                </div>
            </div>
        </div>
    );
}

export default Home;
